%script

CREATE OR REPLACE VIEW CREDIT_SCORING_100K_V AS SELECT * FROM ADMIN.CREDIT_SCORING_100K;
CREATE OR REPLACE VIEW CREDIT_SCORING_NEW_CUST_V AS SELECT * FROM  ADMIN.CREDIT_SCORING_100K;

%sql 

--SELECT CUSTOMER_ID, CREDIT_SCORE_BIN FROM CREDIT_SCORING_100K_V;
SELECT CREDIT_SCORE_BIN, COUNT(*) 
FROM CREDIT_SCORING_100K_V
GROUP BY CREDIT_SCORE_BIN;

%script

-- Create a view that bins ALL the numeric columns.  

BEGIN

BEGIN 
EXECUTE IMMEDIATE 'DROP TABLE bin_num_tbl';
EXCEPTION WHEN OTHERS THEN NULL; 
END; 

BEGIN
EXECUTE IMMEDIATE 'DROP VIEW mining_data_bin_view';
EXCEPTION WHEN OTHERS THEN NULL; 
END; 

   dbms_data_mining_transform.create_bin_num(
           bin_table_name     => 'bin_num_tbl');

   dbms_data_mining_transform.insert_autobin_num_eqwidth(
           bin_table_name     => 'bin_num_tbl',
           data_table_name    => 'CREDIT_SCORING_100K_V',
           bin_num            => 5,
           max_bin_num        => 10,
           exclude_list       => dbms_data_mining_transform.COLUMN_LIST('CUSTOMER_ID'));

  dbms_data_mining_transform.xform_bin_num(
           bin_table_name      => 'bin_num_tbl',
           data_table_name     => 'CREDIT_SCORING_100K_V',
           xform_view_name     => 'mining_data_bin_view');
END;

%sql

-- Note: Typically data scientists shold explore their data to make sure it makes sense and matches the data they believe they are working with. 

SELECT CUSTOMER_ID, AGE, INCOME, TENURE, LOAN_TYPE, LOAN_AMOUNT, OCCUPATION, EDUCATION_LEVEL FROM MINING_DATA_BIN_VIEW;

%script

BEGIN DBMS_DATA_MINING.DROP_MODEL('ai_explain_output_credit_score_bin');
EXCEPTION WHEN OTHERS THEN NULL; END;

DECLARE
    v_setlst DBMS_DATA_MINING.SETTING_LIST;
BEGIN
    v_setlst('ALGO_NAME')        := 'ALGO_AI_MDL';
    V_setlst('PREP_AUTO')        := 'ON';

    DBMS_DATA_MINING.CREATE_MODEL2(
        MODEL_NAME        => 'ai_explain_output_credit_score_bin',
        MINING_FUNCTION   => 'ATTRIBUTE_IMPORTANCE',
        DATA_QUERY        => 'select * from CREDIT_SCORING_100K_V',
        SET_LIST          => v_setlst,
        CASE_ID_COLUMN_NAME => 'CUSTOMER_ID',
        TARGET_COLUMN_NAME  => 'CREDIT_SCORE_BIN');
END;

